import React, { Component } from 'react';
import './App.css';
import Table1 from "./Components/Tabel/Table";

var data = [
    {id: 1, name: 'Gob', value: '2'},
    {id: 2, name: 'Buster', value: '5'},
    {id: 3, name: 'George Michael', value: '4'}
];

function App() {
  return (
    <div className="App">
      <Table1 data={data}/>
    </div>
  );
}

export default App;
